INSERT INTO public.content_node_storyboard_section (id, column1, column2, column3, createtime, updatetime, "position", storyboardid) VALUES
('97156241d07d', 'culpa', 'natus', 'consequatur', '2022-02-02 16:17:18', '2022-02-02 16:17:18', 0, '420bf625f1c9'),
('316c91f30580', NULL, '<p><strong>BLACHEN-MEISTER</strong>: Je eine Untergruppe der beiden Götter hat 13 Blachen, 6 Zelteinheiten und eine Pfaditechnik gefunden (die Gruppe die zuerst da war konnte gute Blachen nehmen, die andere hat Ausschussblachen). Diese beiden Gruppen müssen ein möglichst grosses Zelt bauen, welches alle vorhandenen Blachen verwendet. Dafür haben sie die vollen 30 Minuten zu Verfügung.</p>', NULL, '2022-02-02 16:24:17', '2022-02-02 16:27:27', 4, '11a2e43b1f09'),
('e4548f4634c0', NULL, '<p><strong>SEIL-SPEZIALISTEN</strong>: Je eine Untergruppe der beiden Götter hat Seile und eine Liste mit etwas fortgeschritteneren Knoten erhalten, die teilweise nicht in der Pfaditechnik sind. Diese Knoten sind mit Bildern und Erklärungen beschrieben. Das Ziel dieser Gruppen ist es, möglichst viele dieser Knoten auszuprobieren und sich zu merken. Nach Ablauf der Zeit müssen sie die Knotenbeschreibungen wieder abgeben.</p><p>Die beschriebenen Knoten sind z.B.: Prusik, Pflock-Achten, doppeltes Brezeli (Cosinus erklärt), Würger, Stopper, Spanntauwerfen, Seil aufschiessen, Bünde mit Kant- und Rundhölzern (Elua erklärt), Mastwurf, Maurer, Rettungsschlinge, Weber mit und ohne Auge, Spanner (Pfaditechnik)</p>', NULL, '2022-02-02 16:24:19', '2022-02-02 16:27:32', 5, '11a2e43b1f09'),
('a3318269c0af', NULL, '<p><strong>NATUR-EXPERTEN</strong>: Je eine Untergruppe der beiden Götter hat ein verschlossenes Couvert gefunden, in dem sich Bilder von einigen üblichen Pflanzen und deren Name und Merkmale befinden. Das Ziel dieser beiden Gruppen ist es, möglichst viele der beschriebenen Pflanzen in der Umgebung zu finden und ein Blatt oder ein Foto von der Pflanze mitbringen. Gleichzeitig haben beide Untergruppen eine vorgegebene Feuerstelle, über welche eine Schnur gespannt ist. Die Untergruppen müssen ein Feuer machen das so schnell wie möglich die Schnur durchbrennt.</p>', NULL, '2022-02-02 16:25:23', '2022-02-02 16:27:39', 6, '11a2e43b1f09'),
('6440fb4a5d77', '<p>0:00</p>', '<p>Apollon und Athena streiten sich, wer sich besser mit Pfaditechnik auskennt. Um die Sache zu klären, veranstalten sie einen Wettbewerb. Der Kurs wird auf die beiden Götter aufgeteilt:</p>', 'sunt', '2022-02-02 16:17:18', '2022-02-02 16:29:21', 0, '11a2e43b1f09'),
('5df5aede0e3c', '<p>0:05</p>', '<p>Dazu bekommt jeder TN zwei Zundhölzer und ein Stück Schnur. Die Aufgabe ist es jetzt, die Zundhölzer mit der Schnur rechtwinklig zu verbinden. Alle die fertig sind stehen in eine Schlange (und die TN die es nicht schaffen dürfen bei denen in der Schlange nach Hilfe fragen). In der so entstandenen Reihe nummerieren wir auf zwei durch. So werden Leute mit guten und weniger guten Pfaditechnikkenntnissen durchmischt. Die eine Hälfte der TN geht zu Apollon und die andere Hälfte zu Athena.</p>', NULL, '2022-02-02 16:22:48', '2022-02-02 16:29:23', 1, '11a2e43b1f09'),
('422a506c1d09', '<p>0:15</p>', '<p>Innerhalb der Kurshälften dürfen sich die TN nun noch frei in drei Untergruppen aufteilen. Eine Untergruppe bekommt ein Kroki mit einem markierten Ort, die zweite einen Kompass und eine Azimut- und Distanzangabe und die dritte bekommt eine Karte und Koordinaten. Die drei Untergruppen beider Götter müssen nun diese Orte aufsuchen und das dort liegende Material zurück zum Haus bringen (bzw. nur die Hälfte, sodass die jeweilige Gruppe des anderen Gottes auch noch etwas bekommt).</p>', NULL, '2022-02-02 16:22:51', '2022-02-02 16:29:25', 2, '11a2e43b1f09'),
('c4aba03e2da9', '<p>0:30</p>', '<p>Wenn alle wieder beim Haus versammelt sind, verkünden die Götter, wie es im Wettbewerb weitergeht. Die Gruppen haben eine halbe Stunde Zeit für ihre Aufgaben, danach kommen alle wieder zusammen.</p>', NULL, '2022-02-02 16:23:51', '2022-02-02 16:29:28', 3, '11a2e43b1f09'),
('a8e7108c2cbb', '<p>1:00</p>', '<p>Wir kommen wieder zusammen und bewerten im Plenum die Leistung der Gruppen in den drei Disziplinen.</p>', 'ut', '2022-02-02 16:17:18', '2022-02-02 16:29:31', 0, '69b2f904d812'),
('46fa9619a9f4', '<p>1:00</p>', '<p><strong>BLACHEN-MEISTER</strong>: Die beiden Gruppen zeigen ihr Zelt allen TN und erklären, wie sie es erweitert haben. Die Gruppe kann von 0 bis BLACHEN-MEISTER: Die beiden Gruppen zeigen ihr Zelt allen TN und erklären, wie sie es erweitert haben. Die Gruppe kann von 0 bis 5 Punkte bekommen für:</p><p>- Alle Blachen verbaut</p><p>- Wetterfestigkeit</p><p>- Stabilität</p><p>- Platz</p><p>- Kreativität</p>', NULL, '2022-02-02 16:27:47', '2022-02-02 16:29:35', 1, '69b2f904d812'),
('2eb9c9e32f9b', '<p>1:10</p>', '<p><strong>SEIL-SPEZIALISTEN</strong>: Im Plenum wechseln sich die Knotenspezialisten der beiden Götter ab und erklären und zeigen jeweils einen gelernten Knoten (der noch nicht gezeigt wurde). Die Gruppe die ihr Material zuerst gefunden hat darf beginnen. Jede Gruppe kann maximal 5 Punkte (1 pro gezeigten Knoten) gewinnen.</p>', NULL, '2022-02-02 16:27:51', '2022-02-02 16:29:37', 2, '69b2f904d812'),
('304c224e2440', '<p>1:25</p>', '<p><strong>NATUR-EXPERTEN</strong>: Jede Gruppe die es im Zeitlimit geschafft hat, ihre Schnur durchzubrennen, bekommt 1 Punkt. Im Plenum wechseln sich die Natur-Spezialisten wie die Seil-Experten ab und dürfen jeweils eine gefundene Pflanze (die noch nicht genannt wurde) zeigen und ihre Erkennungsmerkmale erklären. Die Gruppe die zuerst das Material gefunden hat darf beginnen. Jede Gruppe kann maximal 4 Punkte (1 pro gezeigte Pflanze) gewinnen.</p>', NULL, '2022-02-02 16:27:56', '2022-02-02 16:29:40', 3, '69b2f904d812'),
('1179aa25cd77', '<p>1:30</p>', '<p>Zum Abschluss des Muster-LA teilen wir uns nach Disziplinen auf. In jedem dieser Kursdrittel zeigen wir eine Unfallsituation die mit Lego nachgebaut ist. Immer abwechslungsweise können die beiden Götterteams eine Aktion nennen, die in der dargestellten Situation gemacht werden soll. Für jede korrekte Aktion gibt es einen Punkt.</p>', NULL, '2022-02-02 16:28:00', '2022-02-02 16:29:43', 4, '69b2f904d812'),
('b94badf439ee', '<p>1:45</p>', '<p>Nach max. 15 Minuten schliessen wir ab. Die siegreiche Kurshälfte darf später beim Zmittag zuerst Essen holen gehen.</p>', NULL, '2022-02-02 16:28:58', '2022-02-02 16:29:46', 5, '69b2f904d812'),
('b40cebf6dacc', NULL, '<p><strong>Start langes Storyboard</strong></p>', NULL, '2022-02-02 16:36:23', '2022-02-02 16:36:36', 0, 'f4cbcb18d12f'),
